	let t = 0;
	function slowLog(text){ //so console.log won't stop the browser
		if (t % Math.floor(fps/2) == 0){
			console.log(text);
		}
	}
	
	
	function getCharacterOccurrenceInString(c, s){ //https://stackoverflow.com/a/10671743
		return (s.match(new RegExp(c, "g")) || []).length;
	}
	
	function getReversedString(s){ //https://stackoverflow.com/a/959004 (doesn't work on double characters like )
		return s.split("").reverse().join("");
	}
	
	function getSlicedString(s, span){
		return s.slice(span.start, span.end + 1);
	}
	
	
	function randomNum(min, max){
		return Math.floor(Math.random() * (max - min + 1) + min);
	}
	
	function getRandomElementOfArray(arr){
		return arr[Math.floor(Math.random() * arr.length)];
	}
	
	
	function objectLength(arr){
		let length = 0;
		
		if (arr != undefined){
			length = Object.keys(arr).length;
		}
		return length;
	}
	
	
	function areArraysEqual(a, b){ //https://stackoverflow.com/a/16436975/12777947
		if (a === b) return true;
		if (a == null || b == null) return false;
		if (a.length !== b.length) return false;
		
		for (var i = 0; i < a.length; ++i) {
			if (a[i] !== b[i]) return false;
		}
		return true;
	}
	
	function compareObjects1D(a, b){ //https://stackoverflow.com/a/68091909
		return (Object.entries(a).sort().toString() === Object.entries(b).sort().toString());
	}
	
	
	function getArrayWithoutValue(arr, value){ //https://stackoverflow.com/a/5767357
		let index = arr.indexOf(value);
		if (index > -1) {
			arr.splice(index, 1);
		}
		return arr;
	}
	
	function getArrayWithoutRemoveArrayElements(arr, removeArr){ //https://stackoverflow.com/a/19957433
		return arr.filter( function (el){
			return !removeArr.includes(el);
		});
	}
	
	
	function getAverageOfArray(arr){
		return arr.reduce((a, b) => a + b) / arr.length;
	}
	
	
	function getRotatedVertex(x, y, radian, cx, cy){ //https://stackoverflow.com/a/17411276/12777947
		return {
			x: (Math.cos(radian) * (x - cx)) + (Math.sin(radian) * (y - cy)) + cx,
			y: (Math.cos(radian) * (y - cy)) - (Math.sin(radian) * (x - cx)) + cy
		};
	}
	
	
	function getMirroredArray2D(arr){
		for (let i in arr){
			arr[i] = arr[i].reverse();
		}
		return arr;
	}
	
	function getRotatedArray2D(arr, radians){
		let positionArr = [];
		
		let min = {x: 0, y: 0};
		
		for (let i = 0; i < arr.length; i++){
			for (let j = 0; j < arr[i].length; j++){
				let pos = {
					x: Math.round((Math.cos(radians) * j) + (Math.sin(radians) * i)),
					y: Math.round((Math.cos(radians) * i) - (Math.sin(radians) * j)),
					i: i,
					j: j
				};
				
				positionArr.push(pos);
				
				if (pos.x < min.x){ min.x = pos.x };
				if (pos.y < min.y){ min.y = pos.y };
			}
		}
		
		let rotatedArr = [];
		
		for (let i in positionArr){
			let pos = positionArr[i];
			
			pos.x -= min.x;
			pos.y -= min.y;
			
			if (rotatedArr[pos.y] == undefined){
				rotatedArr[pos.y] = [];
			}
			rotatedArr[pos.y][pos.x] = arr[pos.i][pos.j];
		}
		return rotatedArr;
	}
	
	
	function getCurrentTime(){
		return new Date().getTime();
	}

		return (
			(r1.x < (r2.x + r2.w)) && (r1.y < (r2.y + r2.h)) &&
			(r2.x < (r1.x + r1.w)) && (r2.y < (r1.y + r1.h))
		);
	}
	
	function areLinesColliding1D(l1, l2){
		return (l1.end >= l2.start && l2.end >= l1.start);
	}
	
	function isVertexInPolygon(v, p){ //https://stackoverflow.com/a/36070256/12777947
		let j = p.length - 1;
		let odd = false;
		
		for (let i = 0; i < p.length; i++){
			if ((p[i].y < v.y && p[j].y >= v.y || p[j].y < v.y && p[i].y >= v.y) && (p[i].x <= v.x || p[j].x <= v.x)){
				odd ^= (p[i].x + (v.y - p[i].y) * (p[j].x - p[i].x) / (p[j].y - p[i].y)) < v.x;
			}
			j = i;
		}
		return odd;
	}
	
	
	function getClickedPosition(pos){
		if (pos == undefined){
			pos = mousePos;
		}
		
		return {
			x: Math.floor((pos.x - boardPos.x) / boardPos.tileSize),
			y: Math.floor((pos.y - boardPos.y) / boardPos.tileSize)
		}
	}
	
	
	function isPosInBoard(pos){
		let isInBoard = false;
		
		if (currentBoard.length > 0){
			if (pos.x >= 0 && pos.x < currentBoard[0].length &&
				pos.y >= 0 && pos.y < currentBoard.length){
				
				isInBoard = true;
			}
		}
		return isInBoard;
	}

<script> //Direction and Distance between Vertices
	
	function getVertexDistance(v1, v2){
		return Math.sqrt((Math.abs(v1.x - v2.x) ** 2) + (Math.abs(v1.y - v2.y) ** 2));
	}
	
	function getVertexToVertexRadians(v1, v2){
		let deltaX = v2.x - v1.x; 
		let deltaY = v2.y - v1.y;
		
		return Math.atan2(deltaY, deltaX);
	}
	
	function getVertexToVertexDirection(v1, v2){
		let radians = getVertexToVertexRadians(v1, v2);
		
		return {x: Math.cos(radians), y: Math.sin(radians)};
	}

	function startNonogram(clueArr){

	function startEmptyBoard(w, h){
		let clueArr = {rows: [], columns: []};
		
		for (let i = 0; i < w; i++){
			clueArr.columns[i] = [0];
		}
		
		for (let i = 0; i < h; i++){
			clueArr.rows[i] = [0];
		}
		
		startNonogram(clueArr);

	function makeCrossesOnBoard(cross){
		if (cross != undefined){
			for (let x of cross.x){
				for (let i in currentBoard){
					if (x < currentBoard[i].length){
						currentBoard[i][x] = cross.type;
					}
				}
			}
			for (let y of cross.y){
				if (y < currentBoard.length){
					for (let i in currentBoard[y]){
						currentBoard[y][i] = cross.type;
					}
				}
			}
		}
	}
	
	function getRandomRotationOfSymbol(symbol){
		let arr = getRotatedArray2D(symbol, Math.PI/2 * (randomNum(0, 3)));
		
		if (randomNum(0, 1) == 0){
			arr = getMirroredArray2D(arr);
		}
		return arr;
	}
	
	function makeSymbolsOnBoard(symbols){
		if (symbols != undefined){
			for (let i in symbols.names){
				let arr = getRandomRotationOfSymbol(symbolsList[symbols.names[i]]);
				
				let pos = {
					x: randomNum(0, currentBoard[0].length - arr[0].length),
					y: randomNum(0, currentBoard.length - arr.length)
				};
				
				let type = symbols.type;
				
				if (type == "random"){
					type = (randomNum(0, 1) == 0) ? "opposite" : "";
				}
				
				for (let y = 0; y < arr.length; y++){
					for (let x = 0; x < arr[0].length; x++){
						currentBoard[y + pos.y][x + pos.x] = (type == "opposite") ? ((arr[y][x] == ".") ? "x" : ".") : arr[y][x];
					}
				}
			}
		}
	}
	
	
	function startRandomBoard(w, h, cross, symbols){
		currentBoard = [];
		
		for (let y = 0; y < h; y++){
			currentBoard[y] = [];
			
			for (let x = 0; x < w; x++){
				currentBoard[y][x] = (Math.random() > 0.5) ? "x" : ".";
			}
		}
		
		makeSymbolsOnBoard(symbols);
		makeCrossesOnBoard(cross);
		
		changeCluesToCurrentBoard();
		
		startNonogram(currentClues);
	}
	
	
	function startRandomSolvableBoard(w, h, cross, symbols){
		
		let isSolved = false;
		
		while (!isSolved){
			startRandomBoard(w, h, cross, symbols);
			
			resetChangedLines();
			
			isSolved = countSolutionSteps() < maxSteps;
		}
	}
	
	function startRandomSolvableShapeBoard(w, h, shapeData, cross, symbols){
		
		let isSolved = false;
		
		while (!isSolved){
			startEmptyBoard(w, h);
			
			resetChangedLines();
			
			for (let i = 0; i < shapeData.shapeCount; i++){
				inverseTilesInPolygon(getRandomPolygon(shapeData));
			}
			
			if (shapeData.shouldInvert){
				inverseCurrentBoard();
			}
			
			makeSymbolsOnBoard(symbols);
			makeCrossesOnBoard(cross);
			
			changeCluesToCurrentBoard();
			
			isSolved = countSolutionSteps() < maxSteps;
		}
		
		startNonogram(currentClues);
	}
	
	
	function startNextLevel(){
		let level = worlds[currentLevel.worldName][currentLevel.num];
		
		if (savedWorldStates[currentLevel.worldName] == undefined){
			savedWorldStates[currentLevel.worldName] = [];
		}
		
		if (savedWorldStates[currentLevel.worldName][currentLevel.num] == undefined){
			if (level.alert != undefined){
				alert(level.alert);
			}
			if (level.arr != undefined){
				let arr = boards[level.arr.name][level.arr.size];
				
				let difficulties = [];
				for (let i in arr){
					if (i >= level.difficulty.min && i <= level.difficulty.max){
						
						for (let j in arr[i]){
							difficulties.push(i);
						}
					}
				}
				
				let randomDifficulty = getRandomElementOfArray(difficulties);
				
				startNonogram(getRandomElementOfArray(arr[randomDifficulty]));
			} else{
				if (level.clues != undefined){
					startNonogram(level.clues);
				} else{
					let w = randomNum(level.size.w.min, level.size.w.max);
					let h = randomNum(level.size.h.min, level.size.h.max);
					
					let cross = level.cross;
					let symbols = level.symbols;
					
					if (level.shapeData == undefined){
						startRandomSolvableBoard(w, h, cross, symbols);
					} else{
						startRandomSolvableShapeBoard(w, h, level.shapeData, cross, symbols);
					}
				}
			}
		} else{
			currentBoard = structuredClone(savedWorldStates[currentLevel.worldName][currentLevel.num].board);
			currentClues = structuredClone(savedWorldStates[currentLevel.worldName][currentLevel.num].clues);
			
			refreshBoardPosition();

		if (level.fill != undefined){
			for (let i in level.fill){
				for (let j in level.fill[i]){
					let currentTile = level.fill[i][j];
					
					if (currentTile == "." || currentTile == "x"){
						currentBoard[i][j] = currentTile;
					}
				}
			}
		}
		
		isNextButtonShown = false;
		
		saveBoardToSavedWorldStates();
	}

<script> //Old Nonogram Solver Algorithm
	
	function getAllCombinations(numCount, sumAmount){ //This function was written by an AI. (Prompt: In JavaScript, I want a code where you have two variables named "numCount" and "sumAmount", and with those, you get an array that has every possible combination of numbers that add up to the sumAmount. For example, if the numCount is 3, and the sumAmount is 3, then this should be the result: [[0, 0, 3], [0, 1, 2], [0, 2, 1], [0, 3, 0], [1, 0, 2], [1, 1, 1], [1, 2, 0], [2, 0, 1], [2, 1, 0], [3, 0, 0]])
		let result = [];

		function generateCombinations(currentCombination, remainingCount, remainingSum) {
			if (remainingCount === 0) {
				if (remainingSum === 0) {
					result.push([...currentCombination]);
				}
				return;
			}

			for (let i = 0; i <= remainingSum; i++) {
				currentCombination.push(i);
				generateCombinations(currentCombination, remainingCount - 1, remainingSum - i);
				currentCombination.pop();
			}
		}

		generateCombinations([], numCount, sumAmount);

		return result;
	}


	function getAllGapValues(nums, size){
		
		let overallNums = nums.reduce((a, b) => a + b, 0);

		let numOfGaps = nums.length + 1;

		let overallGapValue = size - overallNums;
		let gapValueWithoutMiddle = overallGapValue - numOfGaps + 2;
		
		
		let combinations = getAllCombinations(numOfGaps, gapValueWithoutMiddle);
		
		
		let gapValues = [];
		
		for (let i in combinations){
			gapValues[i] = [];
			
			for (let j in combinations[i]){
				if (j != 0 && j != numOfGaps - 1){
					gapValues[i][j] = combinations[i][j] + 1;
				} else{
					gapValues[i][j] = combinations[i][j];
				}
			}
		}
		
		return gapValues;
	}


	function getAllPossibleLineStates(nums, size){
		let gaps = getAllGapValues(nums, size);
		
		let arr = [];
		
		for (let i in gaps){
			arr[i] = "";
			
			for (let j = 0; j < gaps[i].length + nums.length; j++){
				let isGap = (j % 2 == 0);
				
				let num = (isGap ? gaps[i][Math.floor(j/2)] : nums[Math.floor(j/2)]);
				
				for (let k = 0; k < num; k++){
					arr[i] += isGap ? 0 : 1;
				}
			}
		}
		
		return arr;
	}


	function getCommonsFromLineStates(lineStates, currentState){
		let arr = [];
		
		for (let i in lineStates){
			let isRuledOut = false;
			
			let currentArr = [];
			
			for (let j in lineStates[i]){
				
				if (i == 0){
					arr[j] = [];
				}
				
				if (currentState != undefined){
					if (currentState[j] != " "){
						if (currentState[j] == "x" && lineStates[i][j] == "1"){
							isRuledOut = true;
						}
						if (currentState[j] == "." && lineStates[i][j] == "0"){
							isRuledOut = true;
						}
					}
				}
				
				if (!isRuledOut){
					currentArr[j] = [];
					
					currentArr[j][lineStates[i][j]] = true;
				}
			}
			
			if (!isRuledOut){
				
				for (let j in currentArr){
					arr[j][lineStates[i][j]] = currentArr[j][lineStates[i][j]];
				}
			}
		}
		
		let commons = "";
		for (let i in arr){
			commons += (arr[i][0] == arr[i][1]) ? " " : ((arr[i][0]) ? "x" : ".");
		}
		
		return commons;
	}
	
	
	function oldSolveLine(clue, line){
		return getCommonsFromLineStates(getAllPossibleLineStates(clue, line.length), line);
	}

<script> //New Nonogram Solver Algorithm
	
	function getLineGapsArray(line){ //'gap' here means the area between Xs
		let gaps = [];
		let isNewGap = true;
		for (let i = 0; i < line.length; i++){
			if (line[i] != "x"){
				if (isNewGap){
					gaps.push({gap: "", start: i});
					
					isNewGap = false;
				}
				
				gaps[gaps.length - 1].gap += line[i];
			} else{
				isNewGap = true;
			}
		}
		
		return gaps;
	}
	
	function getLeftmostLinePossibility(clue, line){
		let finalLine = [];
		
		let gaps = getLineGapsArray(line);
		
		let clueNum = 0;
		let gapNum = 0;
		
		while (gapNum < gaps.length){
			let clueSize = clue[clueNum];
			let currentGap = gaps[gapNum].gap;
			
			if (clueSize <= currentGap.length){
				
				let isFollowingFilled = (currentGap[clueSize] == ".");
				
				if (!isFollowingFilled){
					if (clueSize + 1 >= currentGap.length){
						for (let i = 0; i < clueSize; i++){
							finalLine[gaps[gapNum].start + i] = clueNum;
						}
						gapNum++;
					} else{
						for (let i = 0; i < clueSize; i++){
							finalLine[gaps[gapNum].start] = clueNum;
							
							gaps[gapNum].gap = gaps[gapNum].gap.substring(1);
							gaps[gapNum].start++;
						}
						
						gaps[gapNum].gap = gaps[gapNum].gap.substring(1);
						gaps[gapNum].start++;
					}
					clueNum++;
				} else{
					gaps[gapNum].gap = gaps[gapNum].gap.substring(1);
					gaps[gapNum].start++;
				}
			} else{
				gapNum++;
			}
		}
		
		return finalLine;
	}
	
	function getLeftAndRightmostLinePossibilities(clue, line){
		let leftLine = getLeftmostLinePossibility(clue, line);
		let rightLine = getLeftmostLinePossibility([...clue].reverse(), getReversedString(line));
		
		let invertedRightLine = [];
		
		for (let i = 0; i < rightLine.length; i++){
			
			if (rightLine[i] != undefined){
				let inverseI = line.length - i - 1;
				let inverseClueNum = clue.length - rightLine[i] - 1;
				
				invertedRightLine[inverseI] =  inverseClueNum;
			}
		}
		
		return {left: leftLine, right: invertedRightLine};
	}
	
	
	function getMutualLineFromLinePossibilities(line, lines){
		let mutualLine = [...line];
		
		for (let i in line){
			if (lines.left[i] != undefined && lines.right[i] != undefined){
				if (lines.left[i] == lines.right[i]){
					mutualLine[i] = ".";
				}
			}
		}
		
		return mutualLine;
	}
	
	
	function getTileSpansFromLinePossibilities(lines){
		let tileSpans = [];
		
		for (let side in lines){
			for (let i in lines[side]){
				let num = lines[side][i];
				let currentNum = Number(i);
				
				if (tileSpans[num] == undefined){
					tileSpans[num] = {start: currentNum, end: currentNum};
				} else{
					if (currentNum < tileSpans[num].start){
						tileSpans[num].start = currentNum;
					}
					if (currentNum > tileSpans[num].end){
						tileSpans[num].end = currentNum;
					}
				}
			}
		}
		
		return tileSpans;
	}
	
	
	function getFilledTilesArrayFromLine(line){
		let arr = [];
		
		let isPreviousFilled = false;
		let isConnectedToPrevious = false;
		let leftGap = 0;
		
		for (let i = 0; i < line.length; i++){
			if (line[i] == "x"){
				isPreviousFilled = false;
				isConnectedToPrevious = false;
				leftGap = 0;
			} else if (line[i] == "."){
				if (isPreviousFilled){
					arr[arr.length - 1].size++;
					arr[arr.length - 1].end = i;
				} else{
					
					if (isConnectedToPrevious){
						arr[arr.length - 1].isRightFilled = true;
					}
					
					arr.push({size: 1, start: i, end: i, leftGap: leftGap, rightGap: 0, isLeftFilled: isConnectedToPrevious});
					
					
					isPreviousFilled = true;
					isConnectedToPrevious = true;
				}
				
				leftGap = 0;
			} else{
				isPreviousFilled = false;
				
				leftGap++;
				
				if (isConnectedToPrevious){
					arr[arr.length - 1].rightGap++;
				}
			}
		}
		
		return arr;
	}
	
	let hasSolverLineChanged = false;
	
	
	function makeFilledTilesPossibleClueNums(filledTiles, tileSpans, line, clue){
		//make filledTiles
		hasSolverLineChanged = true;
		while (hasSolverLineChanged){
			
			hasSolverLineChanged = false;
			
			//create filledTiles[i].possibleClueNums
			for (let i in filledTiles){
				filledTiles[i].possibleClueNums = [];
				
				if (filledTiles[i].removedClues == undefined){
					filledTiles[i].removedClues = [];
				}
				
				for (let j in tileSpans){
					if (clue[j] >= filledTiles[i].size){
						if (tileSpans[j].end >= filledTiles[i].start && tileSpans[j].start <= filledTiles[i].end){
							
							let numJ = Number(j);
							
							let shouldAdd = true;
							
							if (filledTiles[i].clueNumMin != undefined){
								if (numJ < filledTiles[i].clueNumMin){
									shouldAdd = false;
								}
							}
							if (filledTiles[i].clueNumMax != undefined){
								if (numJ > filledTiles[i].clueNumMax){
									shouldAdd = false;
								}
							}
							
							if (filledTiles[i].removedClues[numJ] != undefined){
								shouldAdd = false;
							}
							
							if (shouldAdd){
								filledTiles[i].possibleClueNums.push(j);
							}
						}
					}
				}
			}
			
			
			//create unconnectedFilledTiles and make min and max possibleClueNums and then remove some filledTiles[i].possibleClueNums if they're over the min or under the max
			let unconnectedFilledTiles = [{filledTileNums: [], clueNums: {min: -1, max: -1}}];
			for (let i = 0; i < filledTiles.length; i++){
				let arr = unconnectedFilledTiles[unconnectedFilledTiles.length - 1];
				
				arr.filledTileNums.push(i);
				
				let minNum = Number(filledTiles[i].possibleClueNums[0]);
				let maxNum = Number(filledTiles[i].possibleClueNums[filledTiles[i].possibleClueNums.length - 1]);
				
				if (arr.clueNums.min > minNum || arr.clueNums.min == -1){
					arr.clueNums.min = minNum;
				}
				if (arr.clueNums.max < maxNum || arr.clueNums.max == -1){
					arr.clueNums.max = maxNum;
				}
				
				
				if ((i + 1) < filledTiles.length){
					let isUnconnected = !filledTiles[i].isRightFilled;
					
					if (!isUnconnected){
						let biggestClueSize = 0;
						
						for (let clueNum of filledTiles[i].possibleClueNums){
							if (filledTiles[i + 1].possibleClueNums.includes(clueNum)){
								if (biggestClueSize < clue[clueNum]){
									biggestClueSize = clue[clueNum];
								}
							}
						}
						
						let gapSize = biggestClueSize - filledTiles[i].size;
						
						if (filledTiles[i].end + gapSize < filledTiles[i + 1].start){
							isUnconnected = true;
						}
					}
					
					if (isUnconnected){
						unconnectedFilledTiles.push({filledTileNums: [], clueNums: {min: -1, max: -1}});
					}
				}
			}
			
			for (let i = 0; i < unconnectedFilledTiles.length; i++){
				if (i + 1 < unconnectedFilledTiles.length){
					if (unconnectedFilledTiles[i].clueNums.max >= unconnectedFilledTiles[i + 1].clueNums.max){
						unconnectedFilledTiles[i].clueNums.max = unconnectedFilledTiles[i + 1].clueNums.max - 1;
						
						for (let num of unconnectedFilledTiles[i].filledTileNums){
							filledTiles[num].clueNumMax = unconnectedFilledTiles[i].clueNums.max;
						}
						
						hasSolverLineChanged = true;
					}
				}
				if (i > 0){
					if (unconnectedFilledTiles[i].clueNums.min <= unconnectedFilledTiles[i - 1].clueNums.min){
						unconnectedFilledTiles[i].clueNums.min = unconnectedFilledTiles[i - 1].clueNums.min + 1;
						
						for (let num of unconnectedFilledTiles[i].filledTileNums){
							filledTiles[num].clueNumMin = unconnectedFilledTiles[i].clueNums.min;
						}
						
						hasSolverLineChanged = true;
					}
				}
			}
			
			
			
			if (!hasSolverLineChanged){
				//connect when filledTiles[i].possibleClueNums are singular and the same
				for (let i = 0; i < filledTiles.length - 1; i++){
					if (filledTiles[i].possibleClueNums.length == 1 && filledTiles[i + 1].possibleClueNums.length == 1){
						if (filledTiles[i].possibleClueNums[0] == filledTiles[i + 1].possibleClueNums[0]){
							
							filledTiles[i].size += filledTiles[i].rightGap + filledTiles[i + 1].size;
							filledTiles[i].rightGap = filledTiles[i + 1].rightGap;
							filledTiles[i].end = filledTiles[i + 1].end;
							filledTiles[i].isRightFilled = filledTiles[i + 1].isRightFilled;
							
							filledTiles.splice(i + 1, 1);
							
							hasSolverLineChanged = true;
						}
					}
				}
				
				
				//remove from filledTiles[i].possibleClueNums if necessary connection would be bigger than it's clueSize
				for (let i = 0; i < filledTiles.length; i++){
					if (filledTiles[i].possibleClueNums.length == 1){
						let clueNum = filledTiles[i].possibleClueNums[0];
						let clueSize = clue[clueNum];
						
						let currentSize = filledTiles[i].size;
						
						let previousEnd = filledTiles[i].end;
						for (let j = i + 1; j < filledTiles.length; j++){
							if (filledTiles[j].possibleClueNums.includes(clueNum)){
								currentSize += filledTiles[j].size + (filledTiles[j].start - previousEnd - 1);
								previousEnd = filledTiles[j].end;
								
								if (currentSize > clueSize){
									filledTiles[j].removedClues[clueNum] = true;
									hasSolverLineChanged = true;
								}
							}
						}
						
						
						currentSize = filledTiles[i].size;
						
						let previousStart = filledTiles[i].start;
						for (let j = i - 1; j >= 0; j--){
							if (filledTiles[j].possibleClueNums.includes(clueNum)){
								currentSize += filledTiles[j].size + (previousStart - filledTiles[j].end - 1);
								previousStart = filledTiles[j].start;
								
								if (currentSize > clueSize){
									filledTiles[j].removedClues[clueNum] = true;
									hasSolverLineChanged = true;
								}
							}
						}
					}
				}
				
				//truncate how big tileSpans can be based on same filledTiles
				for (let i in filledTiles){
					if (filledTiles[i].possibleClueNums.length == 1){
						let clueNum = filledTiles[i].possibleClueNums[0];
						let clueSize = clue[clueNum];
						
						let previousStart = tileSpans[clueNum].start;
						let previousEnd = tileSpans[clueNum].end;
						
						tileSpans[clueNum].start = Math.max(filledTiles[i].start - (clueSize - filledTiles[i].size), tileSpans[clueNum].start);
						tileSpans[clueNum].end = Math.min(filledTiles[i].end + (clueSize - filledTiles[i].size), tileSpans[clueNum].end);
						
						if (previousStart != tileSpans[clueNum].start || previousEnd != tileSpans[clueNum].end){
							hasSolverLineChanged = true;
						}
					}
				}
				
				//truncate tileSpans if start or end would touch another filledTile
				for (let i in tileSpans){
					for (let j in filledTiles){
						if (!filledTiles[j].possibleClueNums.includes(i)){
							if (tileSpans[i].start - 1 == filledTiles[j].end){
								tileSpans[i].start++;
								
								hasSolverLineChanged = true;
							}
							if (tileSpans[i].end + 1 == filledTiles[j].start){
								tileSpans[i].end--;
								
								hasSolverLineChanged = true;
							}
						}
					}
				}
				
				truncateTileSpansEnds(tileSpans, line, clue);
			}
			
		}
	}
	
	function truncateTileSpansEnds(tileSpans, line, clue){
		let didChange = false;
		
		for (let i in tileSpans){
			
			let hasLineChanged = true;
			
			while (hasLineChanged){
				hasLineChanged = false;
				
				let startingTileSpan = {start: tileSpans[i].start, end: tileSpans[i].end};
				
				
				//truncate if start or end is inside an X
				while (line[tileSpans[i].start] == "x"){
					tileSpans[i].start++;
				}
				
				while (line[tileSpans[i].end] == "x"){
					tileSpans[i].end--;
				}
				
				
				//truncate if start and end is touching a filled tile
				while (line[tileSpans[i].start - 1] == "."){
					tileSpans[i].start++;
				}
				
				while (line[tileSpans[i].end + 1] == "."){
					tileSpans[i].end--;
				}
				
				
				//check if the start and end would fit the tiles without an X being in the way
				let clueSize = clue[i];
				
				let startingSpaceNum = 0;
				for (let j = tileSpans[i].start; j <= tileSpans[i].end; j++){
					if (line[j] == "x"){
						if (startingSpaceNum < clueSize){
							startingSpaceNum = 0;
						}
					} else{
						startingSpaceNum++;
						
						if (startingSpaceNum == clueSize){
							tileSpans[i].start = j - (clueSize - 1);
							
							startingSpaceNum++;
						}
					}
				}
				
				let endingSpaceNum = 0;
				for (let j = tileSpans[i].end; j >= tileSpans[i].start; j--){
					if (line[j] == "x"){
						if (endingSpaceNum < clueSize){
							endingSpaceNum = 0;
						}
					} else{
						endingSpaceNum++;
						
						if (endingSpaceNum == clueSize){
							tileSpans[i].end = j + (clueSize - 1);
							
							endingSpaceNum++;
						}
					}
				}
				
				
				if (tileSpans[i].start != startingTileSpan.start || tileSpans[i].end != startingTileSpan.end){
					hasLineChanged = true;
					
					hasSolverLineChanged = true;
					
					didChange = true;
				}
			}
		}
		return didChange;
	}
	
	
	function getPossibleClueMins(filledTiles){
		let possibleClueMins = [];
		
		for (let i in filledTiles){
			if (filledTiles[i].possibleClueNums.length == 1){
				let clueNum = filledTiles[i].possibleClueNums[0];
				
				if (possibleClueMins[clueNum] == undefined){
					possibleClueMins[clueNum] = {start: filledTiles[i].start, end: filledTiles[i].end};
				}
			}
		}
		return possibleClueMins;
	}
	
	function makefilledTilesMaxSpaceAndChangeMutualLineByIt(line, clue, filledTiles, tileSpans, mutualLine){
		
		let possibleClueMins = getPossibleClueMins(filledTiles);
		
		for (let i in filledTiles){
			let numI = Number(i);
			
			
			let maxSpace = {
				left: 0,
				right: 0
			}
			
			for (let clueNum of filledTiles[i].possibleClueNums){
				let clueSize = clue[clueNum];
				
				let space = {left: 0, right: 0};
				
				if (!filledTiles[i].isLeftFilled){
					space.left = filledTiles[i].leftGap;
				} else{
					let currentGapNum = filledTiles[i].leftGap;
					let currentI = numI - 1;
					let shouldLoop = true;
					
					while (filledTiles[currentI] != undefined && shouldLoop){
						shouldLoop = false;
						
						if (filledTiles[currentI].possibleClueNums.includes(clueNum)){
							if (clueSize - currentGapNum > filledTiles[currentI].size){
								currentGapNum += filledTiles[currentI].size + filledTiles[currentI].leftGap;
								
								if (filledTiles[currentI].isLeftFilled){
									currentI--;
									
									shouldLoop = true;
								}
							} else{
								currentGapNum--;
							}
						}
					}
					
					space.left = currentGapNum;
				}
				
				if (!filledTiles[i].isRightFilled){
					space.right = filledTiles[i].rightGap;
				} else{
					let currentGapNum = filledTiles[i].rightGap;
					let currentI = numI + 1;
					let shouldLoop = true;
					
					while (filledTiles[currentI] != undefined && shouldLoop){
						shouldLoop = false;
						
						if (filledTiles[currentI].possibleClueNums.includes(clueNum)){
							if (clueSize - currentGapNum > filledTiles[currentI].size){
								currentGapNum += filledTiles[currentI].size + filledTiles[currentI].rightGap;
								
								if (filledTiles[currentI].isRightFilled){
									currentI++;
									
									shouldLoop = true;
								}
							} else{
								currentGapNum--;
							}
						}
					}
					
					space.right = currentGapNum;
				}//console.log(clueSize,space)
				//console.log(space.right, clueSize, filledTiles[i].size);
				
				//truncate space by missingSize
				let missingSize = clueSize - filledTiles[i].size;
				
				space.left = Math.min(missingSize, space.left);
				space.right = Math.min(missingSize, space.right);
				
				
				//truncate space by tileSpans
				space.left = Math.min(filledTiles[i].start - tileSpans[clueNum].start, space.left);
				space.right = Math.min(tileSpans[clueNum].end - filledTiles[i].end, space.right);
				
				
				
				//truncate space by possibleClueMins
				if (possibleClueMins[clueNum] != undefined){
					let forcedChangeNum = {
						start: Math.max(filledTiles[i].start - possibleClueMins[clueNum].start, 0),
						end: Math.max(possibleClueMins[clueNum].end - filledTiles[i].end, 0)
					}
					
					space = {
						left: Math.min(missingSize - forcedChangeNum.end, space.left),
						right: Math.min(missingSize - forcedChangeNum.start, space.right)
					};
				}
				
				
				let forcedTiles = {
					left: Math.max(missingSize - space.right, 0),
					right: Math.max(missingSize - space.left, 0)
				};
				
				space = {
					left: Math.min(missingSize - forcedTiles.right, space.left),
					right: Math.min(missingSize - forcedTiles.left, space.right)
				}
				
				
				if (maxSpace.left < space.left){
					maxSpace.left = space.left;
				}
				if (maxSpace.right < space.right){
					maxSpace.right = space.right;
				}
				
				//console.log(1,filledTiles[i], tileSpans, clueSize, "[" + clueNum + "]", space, forcedTiles);
			}
			//console.log(maxSpace);
			
			
			//remove from possibleClueNums if it wouldn't fit
			let removeNums = [];
			for (let clueNum of filledTiles[i].possibleClueNums){
				let clueSize = clue[clueNum];
				
				if (clueSize > filledTiles[i].size + maxSpace.left + maxSpace.right){
					removeNums.push(clueNum);
				}
			}
			filledTiles[i].possibleClueNums = getArrayWithoutRemoveArrayElements(filledTiles[i].possibleClueNums, removeNums);
			
			
			//x tiles if maxSpace is 0
			if (maxSpace.left == 0 && filledTiles[i].start - 1 >= 0){
				mutualLine[filledTiles[i].start - 1] = "x";
			}
			if (maxSpace.right == 0 && filledTiles[i].end + 1 < line.length){
				mutualLine[filledTiles[i].end + 1] = "x";
			}
			
			
			filledTiles[i].maxSpace = maxSpace;
		}
		return mutualLine;
	}
	
	
	
	function fillTilesByFilledTilesMinClueSize(clue, filledTiles, mutualLine){
		for (let i in filledTiles){
			
			let minClueSize;
			for (let clueNum of filledTiles[i].possibleClueNums){
				let clueSize = clue[clueNum];
				
				if (minClueSize > clueSize || minClueSize == undefined){
					minClueSize = clueSize;
				}
			}
			
			minMissingSize = minClueSize - filledTiles[i].size;
			if (filledTiles[i].maxSpace.left < minMissingSize){
				let size = minMissingSize - filledTiles[i].maxSpace.left;
				
				for (let j = 1; j <= size; j++){
					if (filledTiles[i].end + j < mutualLine.length){
						mutualLine[filledTiles[i].end + j] = ".";
					}
				}
			}
			if (filledTiles[i].maxSpace.right < minMissingSize){
				let size = minMissingSize - filledTiles[i].maxSpace.right;
				
				for (let j = 1; j <= size; j++){
					if (filledTiles[i].start - j >= 0){
						mutualLine[filledTiles[i].start - j] = ".";
					}
				}
			}
		}
		return mutualLine;
	}
	
	
	function generateEmptyAndFilledSpans(mutualLine){
		let spans = {empty: [], filled: []};
		
		let isCurrentSpanEmpty = true;
		let currentSpan = {start: -1, end: -1};
		for (let i = 0; i < mutualLine.length + 1; i++){
			let tile = mutualLine[i] ?? "x";
			
			if (tile == "x"){
				if (currentSpan.start > -1){
					currentSpan.size = currentSpan.end - currentSpan.start + 1;
					
					if (isCurrentSpanEmpty){
						spans.empty.push(currentSpan);
					} else{
						spans.filled.push(currentSpan)
					}
				}
				
				currentSpan = {start: -1, end: -1};
				isCurrentSpanEmpty = true;
			} else{
				if (currentSpan.start == -1){
					currentSpan.start = i;
				}
				
				currentSpan.end = i;
				
				if (tile == "."){
					isCurrentSpanEmpty = false;
				}
			}
		}
		return spans;
	}
	
	function generateEmptySpansPossibleClueNums(spans, filledTiles, tileSpans, clue){
		for (let i in spans.empty){
			let neighborFilledTileNums = {left: -1, right: -1};
			for (let j in filledTiles){
				if (filledTiles[j].end < spans.empty[i].start){
					neighborFilledTileNums.left = j;
				}
				
				if (neighborFilledTileNums.right == -1){
					if (filledTiles[j].start > spans.empty[i].end){
						neighborFilledTileNums.right = j;
					}
				}
			}
			
			
			let possibleNums = {};
			
			let minNums = {
				left: 0,
				right: clue.length - 1,
			};
			
			let leftNums = [];
			let rightNums = [];
			
			if (neighborFilledTileNums.left > -1){  //assumes filledTiles[j].possibleClueNums is in order (which is should be)
				let leftNums = filledTiles[neighborFilledTileNums.left].possibleClueNums;
				
				minNums.left = Number(leftNums[0]) + 1;
			}
			
			if (neighborFilledTileNums.right > -1){
				let rightNums = filledTiles[neighborFilledTileNums.right].possibleClueNums;
				
				minNums.right = Number(rightNums[rightNums.length - 1]) - 1;
			}
			
			minNums = {
				left: Number(minNums.left),
				right: Number(minNums.right)
			}
			
			spans.empty[i].possibleClueNums = [];
			
			for (let j = minNums.left; j <= minNums.right; j++){
				if (clue[j] <= spans.empty[i].size){
					if (tileSpans[j] != undefined){
						if (areLinesColliding1D(spans.empty[i], tileSpans[j])){
							spans.empty[i].possibleClueNums.push(j);
						}
					}
				}
			}
		}
	}
	
	
	function removePossibleClueNumsIfNotInsideTileSpans(filledTiles, tileSpans){
		for (let i in filledTiles){
			let removeArr = [];
			
			for (let clueNum of filledTiles[i].possibleClueNums){
				if (tileSpans[clueNum].start > filledTiles[i].start || tileSpans[clueNum].end < filledTiles[i].end){
					removeArr.push(clueNum);
				}
			}
			
			filledTiles[i].possibleClueNums = getArrayWithoutRemoveArrayElements(filledTiles[i].possibleClueNums, removeArr);
		}
	}
	
	function removePossibleClueNumsIfNeighborClueNumWouldntHaveSpace(filledTiles, tileSpans, clue){
		for (let i in filledTiles){
			let removeArr = [];
			
			for (let j = 0; j < filledTiles[i].possibleClueNums.length; j++){
				let clueNum = filledTiles[i].possibleClueNums[j];
				
				if (j + 1 < filledTiles[i].possibleClueNums.length){
					let nextClueNum = filledTiles[i].possibleClueNums[j + 1];
					
					let currentEnd = filledTiles[i].end + Math.max(clue[clueNum] - filledTiles[i].size - filledTiles[i].maxSpace.left, 0);
					
					if (tileSpans[nextClueNum].end - (currentEnd + 2) + 1 < clue[nextClueNum]){
						removeArr.push(clueNum);
					}
				}
				
				if (j - 1 >= 0){
					let previousClueNum = filledTiles[i].possibleClueNums[j - 1];
					
					let currentStart = filledTiles[i].start - Math.max(clue[clueNum] - filledTiles[i].size - filledTiles[i].maxSpace.right, 0);
					
					if ((currentStart - 2) - tileSpans[previousClueNum].start + 1 < clue[previousClueNum]){
						removeArr.push(clueNum);
					}
				}
			}
			
			filledTiles[i].possibleClueNums = getArrayWithoutRemoveArrayElements(filledTiles[i].possibleClueNums, removeArr);
		}
	}
	
	
	function generateFilledSpansPossibleClueNums(spans, filledTiles, tileSpans, clue){ //this is a lot simpler than the empty one somehow?
		for (let i in spans.filled){
			spans.filled[i].possibleClueNums = [];
			
			for (let j in tileSpans){
				if (areLinesColliding1D(spans.filled[i], tileSpans[j])){
					spans.filled[i].possibleClueNums.push(j);
				}
			}
		}
	}
	
	function makeXsOnEmptySpansWithoutPossibleClueNums(spans, mutualLine){
		for (let i in spans.empty){
			if (spans.empty[i].possibleClueNums.length == 0){
				for (let j = spans.empty[i].start; j <= spans.empty[i].end; j++){
					if (j >= 0 && j < mutualLine.length){
						mutualLine[j] = "x";
					}
				}
			}
		}
		return mutualLine;
	}
	
	
	function truncateTileSpansByFilledTiles(tileSpans, filledTiles, line, clue){
		for (let i in tileSpans){
			let numI = Number(i);
			
			for (let j in filledTiles){
				if (!filledTiles[j].possibleClueNums.includes(i)){
					
					//if tileSpans start is inside/touching filledTile, push it after the end and also the inverse 
					if (tileSpans[i].start >= filledTiles[j].start - 1 && tileSpans[i].start <= filledTiles[j].end + 1){
						tileSpans[i].start = filledTiles[j].end + 2;
					}
					if (tileSpans[i].end >= filledTiles[j].start - 1 && tileSpans[i].end <= filledTiles[j].end + 1){
						tileSpans[i].end = filledTiles[j].start - 2;
					}
					
					
					let areAllBigger = true;
					let areAllSmaller = true;
					for (let clueNum of filledTiles[j].possibleClueNums){
						if (numI < clueNum){
							areAllSmaller = false;
						}
						if (numI > clueNum){
							areAllBigger = false;
						}
					}
					
					if (areAllSmaller){
						if (tileSpans[i].start <= filledTiles[j].end + 1){
							tileSpans[i].start = filledTiles[j].end + 2;
						}
					} else if (areAllBigger){
						if (tileSpans[i].end >= filledTiles[j].start - 1){
							tileSpans[i].end = filledTiles[j].start - 2;
						}
					}
				} else{
					if (filledTiles[j].possibleClueNums.length > 0){
						if (filledTiles[j].possibleClueNums[0] == numI){
							if (tileSpans[i].end > filledTiles[j].start + (clue[numI] - 1)){
								tileSpans[i].end = filledTiles[j].start + (clue[numI] - 1);
							}
							if (tileSpans[i].end > filledTiles[j].end + filledTiles[j].maxSpace.right){ //might never happen?
								tileSpans[i].end = filledTiles[j].end + filledTiles[j].maxSpace.right;
							}
						}
						if (filledTiles[j].possibleClueNums[filledTiles[j].possibleClueNums.length - 1] == numI){
							if (tileSpans[i].start < filledTiles[j].end - (clue[numI] - 1)){
								tileSpans[i].start = filledTiles[j].end - (clue[numI] - 1);
							}
							if (tileSpans[i].start < filledTiles[j].start - filledTiles[j].maxSpace.left){ //might never happen?
								tileSpans[i].start = filledTiles[j].start - filledTiles[j].maxSpace.left;
							}
						}
					}
				}
			}
		}
		truncateTileSpansEnds(tileSpans, line, clue);
	}
	
	
	function truncateTileSpanEndsIfTheyWouldTouchAnother(tileSpans, line, clue){
		let hasTileSpansChanged = true;
		
		while (hasTileSpansChanged){
			hasTileSpansChanged = false;
			
			for (let i in tileSpans){
				let clueSize = clue[i];
				
				let spanSize = tileSpans[i].end - tileSpans[i].start + 1;
				
				let middlePos = tileSpans[i].end - (spanSize / 2) + 0.5;
				
				let halfTouchNum = Math.max((clueSize - spanSize + (Math.ceil(spanSize / 2) + 1)), 0);
				
				halfTouchNum = Math.min(halfTouchNum, (Math.ceil(spanSize / 2)));
				
				
				if (halfTouchNum > 0){
					let touchSpan = {
						start: Math.floor(middlePos - (halfTouchNum - 1)),
						end: Math.ceil(middlePos + (halfTouchNum - 1))
					};
					
					for (let j in tileSpans){ //this might only need to check neighbors maybe?
						if (i != j){
							if (tileSpans[j].start >= touchSpan.start && tileSpans[j].start <= touchSpan.end){
								tileSpans[j].start = touchSpan.end + 1;
								
								hasTileSpansChanged = true;
							}
							if (tileSpans[j].end >= touchSpan.start && tileSpans[j].end <= touchSpan.end){
								tileSpans[j].end = touchSpan.start - 1;
								
								hasTileSpansChanged = true;
							}
						}
					}
				}
			}
			
			if (truncateTileSpansEnds(tileSpans, line, clue)){
				hasTileSpansChanged = true;
			}
		}
	}
	
	
	function changeMutualLineByTileSpans(tileSpans, mutualLine, line, clue){
		let fillableTiles = [];
		for (let i in tileSpans){
			let clueSize = clue[i];
			
			let spanSize = tileSpans[i].end - tileSpans[i].start + 1;
			
			let halfFillNum = Math.max(clueSize - spanSize + Math.ceil(spanSize / 2), 0);
			
			let middlePos = tileSpans[i].end - (spanSize / 2) + 0.5;
			
			for (let j = 0; j < halfFillNum; j++){
				mutualLine[Math.floor(middlePos - j)] = ".";
				mutualLine[Math.ceil(middlePos + j)] = ".";
			}
			
			for (let j = tileSpans[i].start; j <= tileSpans[i].end; j++){
				fillableTiles[j] = true;
			}
		}
		
		for (let i in line){
			if (!fillableTiles[i]){
				mutualLine[i] = "x";
			}
		}
		return mutualLine;
	}
	
	
	function removeSpansEmptyPossibleClueNumsIfNeighborClueNumWouldntFit(spans, filledTiles, clue){
		//generate lineData
		let lineData = [];
		for (let emptyOrFilled in spans){
			for (let i in spans[emptyOrFilled]){
				for (let j = spans[emptyOrFilled][i].start; j <= spans[emptyOrFilled][i].end; j++){
					lineData[j] = {type: emptyOrFilled, i: i};
				}
			}
		}
		for (let i in filledTiles){
			for (let j = filledTiles[i].start; j <= filledTiles[i].end; j++){
				lineData[j] = {type: "filledTiles", i: i};
			}
		}
		
		//remove spans.empty.possibleClueNums if it's neighbor number couldn't exist since the neighbor filledTiles or in the neighbor filledTiles //for this: solveLine([1,2,1],'-x--x.x-x----x-');
		let didRemove = true;
		while (didRemove){ //not confident with this one
			didRemove = false;
			
			for (let i in spans.empty){
				let previousClueNums = [];
				let nextClueNums = [];
				
				//let neighborFilledTiles = {left: false, right: false};
				
				for (let j = spans.empty[i].start - 1; j >= 0; j--){
					if (lineData[j] != undefined){
						if (lineData[j].type == "filledTiles"){
							let clueNums = filledTiles[lineData[j].i].possibleClueNums;
							
							for (let clueNum of clueNums){
								previousClueNums[clueNum] = true;
							}
							
							//neighborFilledTiles.left = true;
							j = -1;
						} else if (lineData[j].type == "empty"){
							let clueNums = spans.empty[lineData[j].i].possibleClueNums;
							
							for (let clueNum of clueNums){
								previousClueNums[clueNum] = true;
							}
						} else{
							let clueNums = spans.filled[lineData[j].i].possibleClueNums;
							
							for (let clueNum of clueNums){
								previousClueNums[clueNum] = true;
							}
						}
					}
				}
				for (let j = spans.empty[i].end + 1; j < lineData.length; j++){
					if (lineData[j] != undefined){
						if (lineData[j].type == "filledTiles"){
							let clueNums = filledTiles[lineData[j].i].possibleClueNums;
							
							for (let clueNum of clueNums){
								nextClueNums[clueNum] = true;
							}
							
							//neighborFilledTiles.right = true;
							j = lineData.length;
						} else if (lineData[j].type == "empty"){
							let clueNums = spans.empty[lineData[j].i].possibleClueNums;
							
							for (let clueNum of clueNums){
								nextClueNums[clueNum] = true;
							}
						} else{
							let clueNums = spans.filled[lineData[j].i].possibleClueNums;
							
							for (let clueNum of clueNums){
								nextClueNums[clueNum] = true;
							}
						}
					}
				}
				
				
				let removeArr = [];
				for (let clueNum of spans.empty[i].possibleClueNums){
					if (clueNum > 0){
						let previousNum = clueNum - 1;
						
						if (!previousClueNums[previousNum]){
							if (!spans.empty[i].possibleClueNums.includes("" + previousNum) && (spans.empty[i].size <= clue[clueNum] + clue[previousNum])){
								removeArr.push(clueNum);
							}
						}
					}
					if (clueNum < clue.length - 1){
						let nextNum = Number(clueNum) + 1;
						
						if (!nextClueNums[nextNum]){
							if (!spans.empty[i].possibleClueNums.includes("" + nextNum) && (spans.empty[i].size <= clue[clueNum] + clue[nextNum])){
								removeArr.push(clueNum);
							}
						}
					}
					
					//console.log(removeArr, clueNum, previousClueNums, nextClueNums, structuredClone(spans.empty[i].possibleClueNums),i);
				}
				
				
				let previousLength = spans.empty[i].possibleClueNums.length;
				
				spans.empty[i].possibleClueNums = getArrayWithoutRemoveArrayElements(spans.empty[i].possibleClueNums, removeArr);
				
				if (previousLength != spans.empty[i].possibleClueNums.length){
					didRemove = true;
				}
				//console.log(i, spans.empty[i].possibleClueNums, previousClueNums, nextClueNums,neighborFilledTiles,lineData);
			}
		}
	}
	
	
	function xOutDefinitelyEmptyTiles(spans, filledTiles, tileSpans, mutualLine, clue){
		//X out tiles that couldn't have anything on it based on filledTiles[i].maxSpace and filledTiles[i].possibleClueNums and spans.filled and mutualLine
		for (let i in filledTiles){
			let filledSpanNum = -1;
			
			for (let j in spans.filled){
				if (areLinesColliding1D(spans.filled[j], filledTiles[i])){
					filledSpanNum = j;
				}
			}
			
			let mutualXedTiles = [];
			
			if (filledSpanNum > -1){ //should always be true
				let span = spans.filled[filledSpanNum];
				
				for (let clueI in filledTiles[i].possibleClueNums){
					let clueNum = Number(filledTiles[i].possibleClueNums[clueI]);
					
					let clueSize = clue[clueNum];
					let remainingSize = clueSize - filledTiles[i].size;
					
					let xedTiles = {left: [], right: [], mutual: []};
					
					
					let leftSides = {
						left: Math.min(filledTiles[i].maxSpace.left, remainingSize)
					};
					let rightSides = {
						right: Math.min(filledTiles[i].maxSpace.right, remainingSize)
					};
					
					leftSides.right = Math.max(remainingSize - leftSides.left, 0);
					rightSides.left = Math.max(remainingSize - rightSides.right, 0);
					
					
					let previousClue;
					let nextClue;
					
					if (clue[clueNum - 1] != undefined){
						previousClue = {
							size: clue[clueNum - 1],
							span: tileSpans[clueNum - 1]
						};
					}
					if (clue[clueNum + 1] != undefined){
						nextClue = {
							size: clue[clueNum + 1],
							span: tileSpans[clueNum + 1]
						};
					}
					
					//check if previous and nextClue.size belongs to a clue that can exist in the same span
					
					if (filledTiles[i].maxSpace.left > 0){
						let doesPreviousFit = false;
						
						for (let j = filledTiles[i].start - leftSides.left - 1; j >= span.start; j--){
							if (previousClue != undefined){
								if (previousClue.span != undefined){
									if (j != filledTiles[i].start - leftSides.left - 1){
										
										let currentSpan = {start: j - (previousClue.size - 1), end: j};
										
										if (currentSpan.start >= previousClue.span.start && currentSpan.end <= previousClue.span.end){
											if (!getSlicedString(mutualLine, currentSpan).includes("x")){
												if (mutualLine[j - (previousClue.size - 1) - 1] != "."){
													doesPreviousFit = true;
												}
											}
										}
									}
								}
							}
							
							if (!doesPreviousFit){
								xedTiles.left[j] = true;
							}
						}
						
						
						let doesNextFit = false;
						
						for (let j = filledTiles[i].end + leftSides.right + 1; j <= span.end; j++){
							if (nextClue != undefined){
								if (nextClue.span != undefined){
									if (j != filledTiles[i].end + leftSides.right + 1){
										
										let currentSpan = {start: j, end: j + (nextClue.size - 1)};
										
										if (currentSpan.start >= nextClue.span.start && currentSpan.end <= nextClue.span.end){
											if (!getSlicedString(mutualLine, currentSpan).includes("x")){
												if (mutualLine[j + (nextClue.size - 1) + 1] != "."){
													doesNextFit = true;
												}
											}
										}
									}
								}
							}
							
							if (!doesNextFit){
								xedTiles.left[j] = true;
							}
						}
					}
					
					if (filledTiles[i].maxSpace.right > 0){
						let doesPreviousFit = false;
						
						for (let j = filledTiles[i].start - rightSides.left - 1; j >= span.start; j--){
							if (previousClue != undefined){
								if (j != filledTiles[i].start - rightSides.left - 1){
								
									let currentSpan = {start: j - (previousClue.size - 1), end: j};
									
									if (currentSpan.start >= previousClue.span.start && currentSpan.end <= previousClue.span.end){
										if (!getSlicedString(mutualLine, currentSpan).includes("x")){
											if (mutualLine[j - (previousClue.size - 1) - 1] != "."){
												doesPreviousFit = true;
											}
										}
									}
								}
							}
							
							if (!doesPreviousFit){
								xedTiles.right[j] = true;
							}
						}
						
						
						let doesNextFit = false;
						
						for (let j = filledTiles[i].end + rightSides.right + 1; j <= span.end; j++){
							if (nextClue != undefined){
								if (j != filledTiles[i].end + rightSides.right + 1){
									
									let currentSpan = {start: j, end: j + (nextClue.size - 1)};
									
									if (currentSpan.start >= nextClue.span.start && currentSpan.end <= nextClue.span.end){
										if (!getSlicedString(mutualLine, currentSpan).includes("x")){
											if (mutualLine[j + (nextClue.size - 1) + 1] != "."){
												doesNextFit = true;
											}
										}
									}
								}
							}
							
							if (!doesNextFit){
								xedTiles.right[j] = true;
							}
						}
					}
					
					
					if (filledTiles[i].maxSpace.left > 0 && filledTiles[i].maxSpace.right > 0){
						for (let j in xedTiles.left){
							if (xedTiles.right[j]){
								xedTiles.mutual[j] = true;
							}
						}
					} else{
						if (filledTiles[i].maxSpace.left == 0 && filledTiles[i].maxSpace.right > 0){
							xedTiles.mutual = xedTiles.right;
						}
						if (filledTiles[i].maxSpace.left > 0 && filledTiles[i].maxSpace.right == 0){
							xedTiles.mutual = xedTiles.left;
						}
					}
					
					
					mutualXedTiles.push(xedTiles.mutual);
				}
			}
			
			for (let j in mutualXedTiles[0]){
				let isAllX = (mutualXedTiles[0][j]);
				
				for (let k in mutualXedTiles){
					if (!mutualXedTiles[k][j]){
						isAllX = false;
					}
				}
				
				if (isAllX){
					mutualLine[j] = "x";
				}
			}
		}
		return mutualLine;
	}
	
	
	function bruteforceSolveForSingleGaps(clue, mutualLine, originalLine, isBruteforceCallback){
		if (!isBruteforceCallback){
			for (let i = 1; i + 1 < mutualLine.length; i++){
				if (mutualLine[i] != "x" && mutualLine[i] != "."){
					if (mutualLine[i - 1] == "." && mutualLine[i + 1] == "."){
						let clonedMutualLine = [...mutualLine];
						
						clonedMutualLine[i] = ".";
						let filledSolution = solveLine(clue, clonedMutualLine.join(""), originalLine, true);
						
						clonedMutualLine[i] = "x";
						let xedSolution = solveLine(clue, clonedMutualLine.join(""), originalLine, true);
						
						for (let j in filledSolution){
							if (filledSolution[j] == xedSolution[j]){
								mutualLine[j] = filledSolution[j];
							}
						}
					}
				}
			}
		}
		return mutualLine;
	}
	
	
	let aaa = false;
	function solveLine(clue, line, originalLine, isBruteforceCallback){
		let lines = getLeftAndRightmostLinePossibilities(clue, line);
		
		let tileSpans = getTileSpansFromLinePossibilities(lines);
		
		let mutualLine = getMutualLineFromLinePossibilities(line, lines);
		
		let filledTiles = getFilledTilesArrayFromLine(mutualLine);
		
		
		makeFilledTilesPossibleClueNums(filledTiles, tileSpans, line, clue)
		
		
		mutualLine = makefilledTilesMaxSpaceAndChangeMutualLineByIt(line, clue, filledTiles, tileSpans, mutualLine);
		
		mutualLine = fillTilesByFilledTilesMinClueSize(clue, filledTiles, mutualLine);
		
		
		
		let spans = generateEmptyAndFilledSpans(mutualLine);
		generateEmptySpansPossibleClueNums(spans, filledTiles, tileSpans, clue);
		mutualLine = makeXsOnEmptySpansWithoutPossibleClueNums(spans, mutualLine);
		
		
		truncateTileSpansByFilledTiles(tileSpans, filledTiles, line, clue);
		
		
		truncateTileSpanEndsIfTheyWouldTouchAnother(tileSpans, line, clue);
		
		
		mutualLine = changeMutualLineByTileSpans(tileSpans, mutualLine, line, clue);
		
		
		removePossibleClueNumsIfNotInsideTileSpans(filledTiles, tileSpans);
		
		removePossibleClueNumsIfNeighborClueNumWouldntHaveSpace(filledTiles, tileSpans, clue);
		
		//regenerate spans
		spans = generateEmptyAndFilledSpans(mutualLine);
		generateEmptySpansPossibleClueNums(spans, filledTiles, tileSpans, clue);
		generateFilledSpansPossibleClueNums(spans, filledTiles, tileSpans, clue);
		
		
		removeSpansEmptyPossibleClueNumsIfNeighborClueNumWouldntFit(spans, filledTiles, clue);
		
		
		mutualLine = makeXsOnEmptySpansWithoutPossibleClueNums(spans, mutualLine);
		
		
		mutualLine = fillTilesByFilledTilesMinClueSize(clue, filledTiles, mutualLine);
		
		
		mutualLine = xOutDefinitelyEmptyTiles(spans, filledTiles, tileSpans, mutualLine, clue);
		
		
		if (line.length <= 100 && false){
			mutualLine = bruteforceSolveForSingleGaps(clue, mutualLine, originalLine, isBruteforceCallback);
		}
		
		
		//console.log(lines, filledTiles, structuredClone(tileSpans), structuredClone(spans));
		
		
		
		let solvedLine = mutualLine.join("");
		
		if (line != solvedLine){
			//console.log("solveLine recalled itself", solvedLine.replaceAll(" ", "-"));
			originalLine ??= line;
			
			if (solvedLine.length == originalLine.length){
				solvedLine = solveLine(clue, solvedLine, originalLine);
			} else{
				//console.log(clue, line, solvedLine, originalLine)
			}
		}
		
		return solvedLine;
	}

	function generateRandomLine(size, chances){

		let currentChangedLines = structuredClone(changedLines);
		
		changedLines = {x: [], y: []};
		
		for (let xy in currentChangedLines){
			
			let clueI = (xy == "x") ? "columns" : "rows";
			
			for (let j in currentChangedLines[xy]){
				let line = getBoardLine(j, xy);
				
				let text = line + currentClues[clueI][j].join();
				
				let solvedLine = savedLines[text];
				
				if (solvedLine == undefined){
					if (isBoardBruteforce){
						solvedLine = oldSolveLine(currentClues[clueI][j], line);
					} else{
						solvedLine = solveLine(currentClues[clueI][j], line);
					}
					
					savedLines[text] = solvedLine;
				}
				
				setLineToArray(solvedLine, j, xy);
			}
		}
		//addCurrentBoardToUndoBoards(); //can undo randomSizeSmall to solve, it shouldn't be able to
	}
	
</script>
